import React from 'react'

const LoginPage = () => {
  return (
    <form action="" className='max-width-[400px]'>
    <h1 className='text-center font-bold text-3xl'>Login</h1>
        <input type="text" className='bg-[#fff] w-full p-2 block mb-5 border-[#ddd] border-2 rounded-lg'  placeholder='username'/>
        <input type="password" className='bg-[#fff] w-full p-2 block mb-5 border-[#ddd] border-2 rounded-lg'  placeholder='password'/>
        <button className='w-full block bg-[#555] text-[#fff] rounded-lg py-2'>Login</button>
    </form>
  )
}

export default LoginPage
